import React from 'react';
import './App.css';
import Row from './Row'

function App() {
  return (
    <div className="App">
      <h1>Let's build netflix clone front-end today</h1>
      <Row title="NETFLIX ORIGINALS" />
      <Row title="TRENDING NOW" />

    </div>
  );
}

export default App;
